import React from 'react'
import Rates from './components/Rates'
import rateStar from "../../assets/icon-star.svg";
// Rate.jsx

const Rate = ({ rate, setRate, setSubmitted }) => {
  
  const scrollToThankYou = () => {
    const thankYouSection = document.getElementById('thankYouSection');
    if (thankYouSection) {
      thankYouSection.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="container">
      <div className="rate">
        <img src={rateStar} alt="" />
      </div>

      <div className="head">How did we do?</div>
      <div className="title">
        Please let us know how we did with your support request. All feedback
        is appreciated to help us improve our offering!
      </div>

      <div className="evaluation">
        <Rates rate={rate} setRate={setRate} />
      </div>

      <button onClick={() => { setSubmitted(true); scrollToThankYou(); }} className="button">SUBMIT</button>
    </div>
  );
};

export default Rate;
